import { useFavoritosContext } from "../context/FavoritosContext";
export default function Favoritos() {
  const { favoritos } = useFavoritosContext();

  return (
    <div>
      <h1>Lista de Likes</h1>
      {favoritos.map((it) => (

        <img key={it.id}className="foto" src={it.name}  alt={it.desc}   />   
     
      ))}
    </div>
  );
}
